		  }
	   }
	}
 </code>
 </pre>

A layout container control used for aligning items with various sizes in a simple grid.

<h3>Overview</h3>

The control is used to align tiles, cards and other controls in configuration, such as a home page or a dashboard. It represents a grid layout with specific row and column sizes, in which the items can take any number of rows and columns.

The number of columns and rows each item takes can be configured with the use of the <code>{@link sap.f.GridContainerItemLayoutData}</code>.

All rows have the same height and all columns have the same width. Their sizes can be configured with the use of the <code>layout</code> aggregation and <code>{@link sap.f.GridContainerSettings}</code>.

<h3>Usage</h3>

<i>When to use</i> <ul> <li>For aligning home page and dashboard items like Tiles and Cards in a simple grid system with equally sized rows and columns.</li> </ul>

<i>When not to use</i> <ul> <li>If a more complex layout grid system, where columns and rows may vary in size, is needed.</li> </ul>

<h3>Example:</h3> <pre>
&lt;f:GridContainer&gt;
	&lt;f:layout&gt;
		&lt;f:GridContainerSettings rowSize=&quot;5rem&quot; columnSize=&quot;5rem&quot; gap=&quot;1rem&quot; /&gt;
	&lt;/f:layout&gt;
	&lt;f:layoutS&gt;
		&lt;f:GridContainerSettings rowSize=&quot;4rem&quot; columnSize=&quot;4rem&quot; gap=&quot;0.5rem&quot; /&gt;
	&lt;/f:layoutS&gt;
	&lt;f:items&gt;
		&lt;GenericTile header=&quot;Sales Fulfillment&quot;&gt;
			&lt;layoutData&gt;
				&lt;f:GridContainerItemLayoutData rows=&quot;2&quot; columns=&quot;2&quot; /&gt;
			&lt;/layoutData&gt;
		&lt;/GenericTile&gt;
		&lt;w:Card manifest=&quot;url-to-manifest&quot;&gt;
			&lt;w:layoutData&gt;
				&lt;f:GridContainerItemLayoutData rows=&quot;6&quot; columns=&quot;3&quot; /&gt;
			&lt;/w:layoutData&gt;
		&lt;/w:Card&gt;
		&lt;Panel&gt;
			&lt;layoutData&gt;
				&lt;f:GridContainerItemLayoutData columns=&quot;4&quot; /&gt;
			&lt;/layoutData&gt;
			&lt;Text text=&quot;Sales information&quot; /&gt;
		&lt;/Panel&gt;
	&lt;/f:items&gt;
&lt;/f:GridContainer&gt;
</pre>

<h3>Drag and drop:</h3> Drag and drop is enabled for the <code>GridContainer</code> with enhanced visualization and interaction, better suited for grid items. This is configured by using the <code>{@link sap.f.dnd.GridDropInfo}</code>.

Similar to the <code>{@link sap.ui.core.dnd.DropInfo}</code>, <code>{@link sap.f.dnd.GridDropInfo}</code> has to be added to the <code>dragDropConfig</code> aggregation, by using <code>{@link sap.ui.core.Element#addDragDropConfig}</code>.

Both <code>{@link sap.ui.core.dnd.DropInfo}</code> and <code>{@link sap.f.dnd.GridDropInfo}</code> can be used to configure drag and drop. The difference is that the <code>{@link sap.f.dnd.GridDropInfo}</code> will provide a drop indicator, which mimics the size of the dragged item and shows the potential drop position inside the grid.

Drag and drop is enabled via keyboard using <code>Ctrl</code> + arrow keys (Windows) and <code>Control</code> + arrow keys (Mac OS).

<h3>Keyboard Navigation:</h3> <code>GridContainer</code> provides support for two-dimensional keyboard navigation through its contained controls. Navigating up/down or left/right using the arrow keys follows the configurable two-dimensional grid mesh. This provides stable navigation paths in the cases when there are items of different sizes. When the user presses an arrow key in a direction outward of the <code>GridContainer</code>, a <code>borderReached</code> event will be fired. The implementation of the <code>borderReached</code> event allows the application developer to control where the focus goes, and depending on the surrounding layout pass the focus to a specific place in a neighboring <code>GridContainer</code> using the method {@link #focusItemByDirection}.

config.description:
This config allows all the values oOptions.targets.anyName allows, these will be the default values for properties used in the target.

For example, if you are only using xmlViews in your app you can specify viewType="XML" so you don't have to repeat this in every target.

If a target specifies viewType="JS", the JS will be stronger than the XML here is an example.

<pre>
<code>
{
    config: {
        viewType : "XML"
    }
    targets : {
        xmlTarget : {
            ...
        },
        jsTarget : {
            viewType : "JS"
            ...
        }
    }
}
</code>
</pre> Then the effective config that will be used looks like this: <pre>
<code>
{
    xmlTarget : {
        // coming from the defaults
        viewType : "XML"
        ...
    },
    jsTarget : {
       // XML is overwritten by the "JS" of the targets property
       viewType : "JS"
      ...
    }
}
</code>
</pre>

name.description:
Defines the name of the View or Component that will be created. For type 'Component', use option <code>usage</code> instead if an owner component exists. To place the view or component into a Control, use the options <code>controlAggregation</code> and <code>controlId</code>. Instance of View or Component will only be created once per <code>name</code> or <code>usage</code> combined with <code>id</code>. <pre>
<code>
{
    targets: {
        // If display("masterWelcome") is called, the master view will be placed in the 'MasterPages' of a control with the id splitContainter
        masterWelcome: {
            type: "View",
            name: "Welcome",
            controlId: "splitContainer",
            controlAggregation: "masterPages"
        },
        // If display("detailWelcome") is called after the masterWelcome, the view will be removed from the master pages and added to the detail pages, since the same instance is used. Also the controls inside of the view will have the same state.
        detailWelcome: {
            // same view here, that's why the same instance is used
            type: "View",
            name: "Welcome",
            controlId: "splitContainer",
            controlAggregation: "detailPages"
        }
    }
}
</code>
</pre>

If you want to have a second instance of the welcome view you can assign the targets with different ids:

<pre>
<code>
{
    targets: {
        // If display("masterWelcome") is called, the "masterWelcome" view will be placed in the 'MasterPages' of a control with the id splitContainter
        masterWelcome: {
            type: "View",
            name: "Welcome",
            id: "masterWelcome",
            controlId: "splitContainer",
            controlAggregation: "masterPages"
        },
        // If display("detailWelcome") is called after the "masterWelcome", a second instance with an own controller instance will be added in the detail pages.
        detailWelcome: {
            type: "View",
            name: "Welcome",
            // another instance will be created because a different id is used
            id: "detailWelcome",
            controlId: "splitContainer",
            controlAggregation: "detailPages"
        }
    }
}
</code>
</pre>

parent.description:
A reference to another target, using the name of the target. If you display a target that has a parent, the parent will also be displayed. Also the control you specify with the controlId parameter, will be searched inside of the view of the parent not in the rootView, provided in the config. The control will be searched using the byId function of a view. When it is not found, the global id is checked.

The main usecase for the parent property is placing a view inside a smaller container of a view, which is also created by targets. This is useful for lazy loading views, only if the user really navigates to this part of your application.

<b>Example:</b> Our aim is to lazy load a tab of an IconTabBar (a control that displays a view initially and when a user clicks on it the view changes). It's a perfect candidate to lazy load something inside of it.

<b>Example app structure:</b>

We have a <code>rootView</code> that is returned by the <code>createContent</code> function of our <code>UIComponent</code>. This view contains an <code>sap.m.App</code> control with the ID 'myApp' <pre>
<code>
&lt;View xmlns="sap.m"&gt;
    &lt;App id="myApp"/&gt;
&lt;/View&gt;
</code>
</pre> an xml view called 'Detail' <pre>
<code>
&lt;View xmlns="sap.m"&gt;
    &lt;IconTabBar&gt;
        &lt;items&gt;
            &lt;IconTabFilter&gt;
                &lt;!-- content of our first tab --&gt;
            &lt;IconTabFilter&gt;
            &lt;IconTabFilter id="mySecondTab"&gt;
                &lt;!-- nothing here, since we will lazy load this one with a target --&gt;
            &lt;IconTabFilter&gt;
        &lt;/items&gt;
    &lt;/IconTabBar&gt;
&lt;/View&gt;
</code>
</pre> and a view called 'SecondTabContent', this one contains our content we want to have lazy loaded. Now we need to create our <code>Targets</code> instance with a config matching our app: <pre>
<code>
    new Targets({
        //Creates our views except for root, we created this one before - when using a component you
        views: new Views(),
        config: {
            // all of our views have that type
            viewType: 'XML',
            // a reference to the app control in the rootView created by our UIComponent
            controlId: 'myApp',
            // An app has a pages aggregation where the views need to be put into
            controlAggregation: 'pages',
            // all targets have type "View"
            type: "View"
        },
        targets: {
            detail: {
                name: 'Detail'
            },
            secondTabContent: {
                // A reference to the detail target defined above
                parent: 'detail',
                // A reference to the second Tab container in the Detail view. Here the target does not look in the rootView, it looks in the Parent view (Detail).
                controlId: 'mySecondTab',
                // An IconTabFilter has an aggregation called content so we need to overwrite the pages set in the config as default.
                controlAggregation: 'content',
                // A view containing the content
                name: 'SecondTabContent'
            }
        }
    });
</code>
</pre>

Now, if we call <code> oTargets.display("secondTabContent") </code>, 2 views will be created: Detail and SecondTabContent. The 'Detail' view will be put into the pages aggregation of the App. And afterwards the 'SecondTabContent' view will be put into the content Aggregation of the second IconTabFilter. So a parent will always be created before the target referencing it.

level.description:
If you are having an application that has a logical order of views (eg: a create account process, first provide user data, then review and confirm them). You always want to show a backwards transition if a navigation from the confirm to the userData page takes place. Therefore you may use the <code>level</code>. The <code>level</code> has to be an integer. The user data page should have a lower number than the confirm page. These levels should represent the user process of your application and they do not have to match the container structure of your Targets. If the user navigates between targets with the same <code>level</code>, a forward transition is taken. If you pass a direction into the display function, the <code>level</code> will be ignored.

<b>Example:</b>

<pre>
<code>
    {
        targets: {
            startPage: {
                level: 0
                // more properties
            },
            userData: {
                level: 1
                // more properties
            },
            confirmRegistration: {
                level: 2
                // more properties
            },
            settings: {
                //no view level here
            }
        }
    }
</code>
</pre>

Currently the 'userData' target is displayed. <ul> <li> If we navigate to 'startPage' the navContainer will show a backwards navigation, since the <code>level</code> is lower. </li> <li> If we navigate to 'userData' the navContainer will show a forwards navigation, since the <code>level</code> is higher. </li> <li> If we navigate to 'settings' the navContainer will show a forwards navigation, since the <code>level</code> is not defined and cannot be compared. </li> </ul>

anyName.description:
A new target, the key severs as a name.

Example: <pre>
<code>
{
    targets: {
        welcome: {
            type: "View",
            name: "Welcome",
            viewType: "XML",
            ....
            // Other target parameters
        },
        goodbye: {
            type: "View",
            name: "Bye",
            viewType: "JS",
            ....
            // Other target parameters
        }
    }
}
</code>
</pre>

This creates two targets named 'welcome' and 'goodbye'. You can display both of them or one of them using the <code>{@link #display}</code> function.
